import React from "react";
import "./style.css";
import img1 from "../../assets/react1.jpeg";
function Styling() {
  return (
    <>
      <div className="card">
        <div className="cardHead">
          <img src={img1} alt="/"></img>
        </div>
        <div className="cardBody">
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Animi
          nesciunt magni, iusto eos blanditiis nulla libero, consequatur
          incidunt facere iste cum. Quibusdam quod sit minus accusamus deleniti,
          quia sint reiciendis? Odio sit saepe impedit, corporis doloribus sunt
          velit. Dignissimos reiciendis fugiat labore, aut obcaecati impedit
          incidunt totam, neque repudiandae saepe consequuntur quisquam vero
          aspernatur maiores recusandae voluptas cupiditate, repellendus
          deserunt. Nostrum esse deleniti fuga laudantium accusamus eum,
          expedita debitis nam quae. Iure, corrupti nisi, dolorum obcaecati,
          sequi modi id tempora aperiam nam eaque sapiente exercitationem
          molestiae repellendus eius alias praesentium.
        </div>
      </div>
    </>
  );
}

export default Styling;
